import React, { Component } from 'react';

class Navbar extends Component{
    render(){
        return(
            <nav class="navbar bg-light">
                <div class="container">
                    <img src={this.props.logo} alt="kebab" width="30" height="24"/>
                </div>
            </nav>
        );
    }
}

export default Navbar;
